import { creatBrowserRouter, RouterProvider } from "react-router-dom";
function App() {
  const r = creatBrowserRouter([
    {
      path:"/",
      element:<></>
    }
  ])
  return <div className="App">
    <RouterProvider router={r}/>
  </div>;
}

export default App;
